import React, { useState } from 'react';
import TodoList from './TodoList';

function App() {
  const [tasks, setTasks] = useState([]);

  return (
    <div className="App">
      <TodoList tasks={tasks} setTasks={setTasks} />
    </div>
  );
}

export default App;
